import React from 'react';
import logo from './logo.svg';
import './App.css';
import Index from './components/Index';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { Switch, Route, BrowserRouter } from 'react-router-dom'
import createResult from './components/createResult';
import readResults from './components/readResults';
import Update from './components/update';


class App extends React.Component {

  render() {
    return (
      <BrowserRouter>
        <div className="App">
          <Navbar bg="info" variant="dark">
            <Nav className="mr-auto">
              <Nav.Link href="/">Home</Nav.Link>
              <Nav.Link href="/readResults">Read</Nav.Link>
              <Nav.Link href="/createResult">Create</Nav.Link>
            </Nav>
          </Navbar>
          <Switch>
            <Route exact path="/" component={Index} />
            <Route path="/createResult" component={createResult} />
            <Route path="/readResults" component={readResults} />
            <Route path="/Update/:id" component={Update} />
          </Switch>
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
